import{_ as a,c as e,o as r,V as t}from"./chunks/framework.CK8YuoVq.js";const f=JSON.parse('{"title":"Uniapp APP云打包 安卓 和 IOS 开发记录","description":"","frontmatter":{},"headers":[],"relativePath":"posts/Uniapp打包安卓和IOS.md","filePath":"posts/Uniapp打包安卓和IOS.md","lastUpdated":1710741013000}'),l={name:"posts/Uniapp打包安卓和IOS.md"},i=t('<h1 id="uniapp-app云打包-安卓-和-ios-开发记录" tabindex="-1">Uniapp APP云打包 安卓 和 IOS 开发记录 <a class="header-anchor" href="#uniapp-app云打包-安卓-和-ios-开发记录" aria-label="Permalink to &quot;Uniapp APP云打包 安卓 和 IOS 开发记录&quot;">​</a></h1><h2 id="基础信息完善" tabindex="-1">基础信息完善 <a class="header-anchor" href="#基础信息完善" aria-label="Permalink to &quot;基础信息完善&quot;">​</a></h2><ol><li>基础配置</li><li>App 图标配置</li><li>App 启动页配置（通用启动界面、自定义）</li></ol><h2 id="开发测试" tabindex="-1">开发测试 <a class="header-anchor" href="#开发测试" aria-label="Permalink to &quot;开发测试&quot;">​</a></h2><p>安卓：本地开发直接运行在本地浏览器即可，调试可先打自定义基座后运行在模拟器上或者通过 USB 连接手机调试</p><p>IOS：需要借用 iTunes，通过 USB 连接手机，运行在手机上，使用自定义基座后运行，通过 USB 连接手机调试</p><p>体验：可使用 <a href="https://www.pgyer.com/" target="_blank" rel="noreferrer">蒲公英</a> 发布后进行体验版使用</p><h2 id="打包配置" tabindex="-1">打包配置 <a class="header-anchor" href="#打包配置" aria-label="Permalink to &quot;打包配置&quot;">​</a></h2><p>安卓 和 IOS 都需要配置相关信息</p><h3 id="安卓" tabindex="-1">安卓 <a class="header-anchor" href="#安卓" aria-label="Permalink to &quot;安卓&quot;">​</a></h3><p>安卓证书使用指南：<a href="https://ask.dcloud.net.cn/article/35985" target="_blank" rel="noreferrer">https://ask.dcloud.net.cn/article/35985</a></p><p>可以使用自由证书或者云端证书</p><p>安卓自有证书生成指南：<a href="https://ask.dcloud.net.cn/article/35777" target="_blank" rel="noreferrer">https://ask.dcloud.net.cn/article/35777</a></p><ol><li>证书别名</li><li>证书私钥密码</li><li>证书文件</li></ol><h3 id="ios" tabindex="-1">IOS <a class="header-anchor" href="#ios" aria-label="Permalink to &quot;IOS&quot;">​</a></h3><ol><li>证书私钥密码</li><li>证书 <code>profile</code> 文件</li><li>私钥证书</li></ol><p>前提是苹果开发者账号，并且已经创建了 AppID，必须在Mac电脑上才可以创建上面这些东西</p><p>如果不是苹果电脑可以使用 <a href="https://www.yunedit.com/" target="_blank" rel="noreferrer">香蕉云编</a> 去生成</p><h2 id="注意" tabindex="-1">注意 <a class="header-anchor" href="#注意" aria-label="Permalink to &quot;注意&quot;">​</a></h2><ol><li>苹果手机的 <code>UDID</code> 标识可以通过爱思助手获取</li><li>IOS 开发描述文件必须绑定调试设备，只有授权的设备才可以直接安装基座，所以在申请开发描述文件之前，先添加调试的 IOS 设备的 UDID</li></ol><h2 id="参考文章" tabindex="-1">参考文章 <a class="header-anchor" href="#参考文章" aria-label="Permalink to &quot;参考文章&quot;">​</a></h2><ol><li><a href="https://juejin.cn/post/7216608199012237372" target="_blank" rel="noreferrer">最新uniapp打包IOS详细步骤</a></li><li><a href="https://juejin.cn/post/7264939254290579495" target="_blank" rel="noreferrer">教你做事，uniapp ios App 打包全流程</a></li><li><a href="https://www.bilibili.com/video/BV1Jp4y1V7ad/" target="_blank" rel="noreferrer">uniapp打包上线微信小程序、安卓、IOS流程</a></li><li><a href="https://blog.csdn.net/cengjing123_/article/details/129490094" target="_blank" rel="noreferrer">uniapp运行到IOS真机提示 错误:请查看是否设备未加入到证书列表或者确认证书类型是否匹配</a></li><li><a href="https://blog.csdn.net/weixin_48914851/article/details/114979266" target="_blank" rel="noreferrer">hbuilderx云打包ios证书的生成方法</a></li><li><a href="https://juejin.cn/post/7282972975933964323" target="_blank" rel="noreferrer">uniapp项目实践总结(二十四)安卓平台 APP 打包教程</a></li><li><a href="https://juejin.cn/post/7284221961621028919" target="_blank" rel="noreferrer">uniapp项目实践总结(二十五)苹果 ios 平台 APP 打包教程</a></li><li><a href="https://ask.dcloud.net.cn/article/37835" target="_blank" rel="noreferrer">最新 App store 上架教程（uni-app版）</a></li></ol>',22),n=[i];function o(p,s,h,c,d,_){return r(),e("div",null,n)}const b=a(l,[["render",o]]);export{f as __pageData,b as default};
